import React from 'react'

const Navbar = (props) => {
  return (
    <div>
       <nav className='navbar'>
                        <button className='btn btn-1' onClick={props.HomePageHandler}>Home</button>
                        <button className='btn btn-2' onClick={props.UnitsPageHandler}>Units</button>
                    </nav>
    </div>
  )
}

export default Navbar;
